int main(void) {

	//match loop
	while(1){
		callLoadingScreen();
		
		//buffering registers
		volatile int * pixel_ctrl0_ptr = (int *)0xFF203020;    
		pixel_buffer_start = *pixel_ctrl0_ptr;
		
		volatile int * pixel_ctrl1_ptr = (int *)0xFF203024;    
		pixel_back_buffer_start = *pixel_ctrl1_ptr;
		

		//player attributes
		initialization(&playerOne, 80);
		initialization(&playerTwo, 160);

		//fill the sprite arrays
		for(int i=0; i<playerOne.spriteDimension*playerOne.spriteDimension; i++){
			playerOne.rightSprite[i] = marioRight[i];
			playerOne.leftSprite[i] = marioLeft[i];
			playerOne.rightAttackSprite[i] = marioRightPunch[i];
			playerOne.leftAttackSprite[i] = marioLeftPunch[i];
		}
		//fill the sprite array
		for(int i=0; i<playerOne.spriteDimension*playerOne.spriteDimension; i++){
			playerTwo.rightSprite[i] = pikachuRight[i];
			playerTwo.leftSprite[i] = pikachuLeft[i];
			playerTwo.rightAttackSprite[i] = pikachuRightAttack[i];
			playerTwo.leftAttackSprite[i] = pikachuLeftAttack[i];
		}

		//solid_color(fbp, 0xffff);//all white
		draw_map();

		//keyboard polling
		unsigned char byte1 = 0;
		unsigned char byte2 = 0;
		unsigned char byte3 = 0;

		unsigned char byteA = 0;
		unsigned char byteB = 0;
		unsigned char byteC = 0;

		volatile int * PS2_ptr1 = (int *) 0xFF200100;  // PS/2 port address
		volatile int * PS2_ptr2 = (int *) 0xFF200108;  // PS/2 port address
		volatile int * RLEDs = (int *) 0xFF200000;     // Red LEDs base address

		int PS2_data1, PS2_data2, RVALID1, RVALID2;


		//game loop
		while (1) {
			//if anyone is dead, go to winner screen
			if(playerOne.isDead){
				callPikachuWinsScreen();
				break;//leave the current game
			}else if(playerTwo.isDead){
				callMarioWinsScreen();
				break; //leave the current game
			}


			//UPDATING NATURAL GAME PHYSICS (without user input)

			//countdown the attacking frames
			if(playerOne.attackFrame != 0){
				playerOne.attackFrame--;
				//50% of the cooldown time is actual attack, the rest u have to wait to use attack again
				if(playerOne.attackFrame < (3*attack_frame_length/4)){
					playerOne.attacking = false;
				}
			}
			if(playerTwo.attackFrame != 0){
				playerTwo.attackFrame --;
				if(playerTwo.attackFrame < (3*attack_frame_length/4)){
					playerTwo.attacking = false;
				}
			}

			gravity(&playerOne, &playerOne.yVelocity, playerOne.yVelocity, playerOne.timeInAir); //update y velocity due to (gravity)
			gravity(&playerTwo, &playerTwo.yVelocity, playerTwo.yVelocity, playerTwo.timeInAir);

			//check if on ground, update physics attribtues
			update_physics_on_ground(&playerOne);
			update_physics_on_ground(&playerTwo);

			//update for player collisions
			x_playerCollision(&playerOne, &playerTwo); 
			x_playerCollision(&playerTwo, &playerOne); 

			//KEYBOARD POLLING
			PS2_data1 = *(PS2_ptr1);	// read the Data register in the PS/2 port
			RVALID1 = (PS2_data1 & 0x8000);	// extract the RVALID field
			PS2_data2 = *(PS2_ptr2);	// read the Data register in the PS/2 port
			RVALID2 = (PS2_data2 & 0x8000);	// extract the RVALID field

			if (RVALID1 != 0)
			{
				/* always save the last three bytes received */
				byte1 = byte2;
				byte2 = byte3;
				byte3 = PS2_data1 & 0xFF;
			}

			if (RVALID2 != 0)
			{
				/* always save the last three bytes received */
				byteA = byteB;
				byteB = byteC;
				byteC = PS2_data2 & 0xFF;
			}

			//at the start of the loop, xvelocity should be zero until it is updated
			//playerOne.xVelocity = 0;
			//playerTwo.xVelocity = 0; commenting this out makes it work

			// Check if a key is pressed for player 1 (not released)
			if (byte2 == 0xF0 && byte3 != 0x00) {
				// If a key is pressed, turn on the LEDs
				playerOne.xVelocity = 0;
			} else if (byte2 != 0xF0 && byte3 == 0x1D) {//W
				W_KEY_PRESSED();
			} else if (byte2 != 0xF0 && byte3 == 0x1C) {//A
				A_KEY_PRESSED();
			} else if (byte2 != 0xF0 && byte3 == 0x1B) {//S
				//S_KEY_PRESSED();
			} else if (byte2 != 0xF0 && byte3 == 0x23) {//D
				D_KEY_PRESSED();
			} else if (byte2 != 0xF0 && byte3 == 0x2D) {//R
				R_KEY_PRESSED();
			} 

			//player 2 below
			if (byteB == 0xF0 && byteC != 0x00) {
				// If a key is pressed, turn on the LEDs
				playerTwo.xVelocity = 0;
			} else if (byteB != 0xF0 && byteC == 0x1D) {//W
				UP_KEY_PRESSED();
			} else if (byteB != 0xF0 && byteC == 0x1C) {//A
				LEFT_KEY_PRESSED();
			} else if (byteB != 0xF0 && byteC == 0x1B) {//S
				//DOWN_KEY_PRESSED();
			} else if (byteB != 0xF0 && byteC == 0x23) {//D
				RIGHT_KEY_PRESSED();
			} else if (byteB != 0xF0 && byteC == 0x2D){ // 4
				FOUR_KEY_PRESSED();
			}

			//update position due to velocity
			playerOne.yCoord = playerOne.yCoord + playerOne.yVelocity;
			playerOne.xCoord = playerOne.xCoord + playerOne.xVelocity;

			playerTwo.yCoord = playerTwo.yCoord + playerTwo.yVelocity;
			playerTwo.xCoord = playerTwo.xCoord + playerTwo.xVelocity;


			//if out of bounds, set player to isDead = true
			if(playerOne.xCoord+allSpriteDims >320 || playerOne.xCoord < 0
			|| playerOne.yCoord+allSpriteDims > 240 || playerOne.yCoord < 0){
				playerOne.isDead = true;
				continue; //dont draw
			}else if(playerTwo.xCoord+allSpriteDims > 320 || playerTwo.xCoord < 0 
			|| playerTwo.yCoord+allSpriteDims > 240 || playerTwo.yCoord < 0){
				playerTwo.isDead = true;
				continue;//
			}

			//3. draw to backbuffer
			/* *************************************************** */

			draw_map();

			//draw player "health" (damages)
			displayPlayerDamage(&playerOne,5,5, 0);//playerOne Health
			displayPlayerDamage(&playerTwo,235,5, 0);//playerTwo Health

			//redraw sprite
			//sprites differ depending on direction, attacking, etc
				
			if(playerOne.facing=='R' && playerOne.attacking){ //right and attacking
				sprite_draw(fbp, playerOne.rightAttackSprite , allSpriteDims, allSpriteDims, playerOne.xCoord, playerOne.yCoord);
			}else if(playerOne.facing=='R'){ //right, but not attacking
				sprite_draw(fbp, playerOne.rightSprite , allSpriteDims, allSpriteDims, playerOne.xCoord, playerOne.yCoord);
			}else if(playerOne.facing=='L' && playerOne.attacking){//facing left and attacking
				sprite_draw(fbp, playerOne.leftAttackSprite , allSpriteDims, allSpriteDims, playerOne.xCoord, playerOne.yCoord);
			}else if(playerOne.facing=='L'){//facing left, but not attacking
				sprite_draw(fbp, playerOne.leftSprite , allSpriteDims, allSpriteDims, playerOne.xCoord, playerOne.yCoord);
			}
				
			if(playerTwo.facing=='R' && playerTwo.attacking){//facing right, and attacking
				sprite_draw(fbp, playerTwo.rightAttackSprite , allSpriteDims, allSpriteDims, playerTwo.xCoord, playerTwo.yCoord);
			}else if(playerTwo.facing=='R'){ //facing right, but not attacking
				sprite_draw(fbp, playerTwo.rightSprite , allSpriteDims, allSpriteDims, playerTwo.xCoord, playerTwo.yCoord);
			}else if(playerTwo.facing=='L' && playerTwo.attacking){//left, attacking
				sprite_draw(fbp, playerTwo.leftAttackSprite , allSpriteDims, allSpriteDims, playerTwo.xCoord, playerTwo.yCoord);
			}else if(playerTwo.facing=='L'){//facing left, but not attacking
				sprite_draw(fbp, playerTwo.leftSprite , allSpriteDims, allSpriteDims, playerTwo.xCoord, playerTwo.yCoord);
			}

			/* *************************************************** */

			//3. buffer swap
			//buffer_swap();

			//pixel_buffer_start = *(pixel_ctrl0_ptr + 1);

			/*

			if (pixel_buffer_start == * pixel_ctrl0_ptr) {
				pixel_buffer_start = *pixel_ctrl1_ptr;
			} else {
				pixel_buffer_start = *pixel_ctrl1_ptr;
			}

			*/


		}
	}
}

void initialization(struct player *player, int starting) {

    //player attributes
    player->facing = 'R';
    player->attackFrame = 0;
    player->spriteDimension = allSpriteDims; //25 for mario
	player->rightSprite = (short *)malloc(25*25*sizeof(short));
    player->leftSprite = (short *)malloc(25*25*sizeof(short));
    player->rightAttackSprite = (short *)malloc(25*25*sizeof(short));
    player->leftAttackSprite = (short *)malloc(25*25*sizeof(short));
	
    player->xCoord = starting;//starting position
    player->yCoord = ground_level;

    player->xVelocity = 0;
    player->yVelocity = 0;
    player->timeInAir = 0;
	player->damageTaken = 0;
	player->touching = false;
	player->isDead = false;
	player->attacking = false;

}

//player's damage to display, x position to display the %, y position to display the %
void displayPlayerDamage(struct player *player, int xPos, int yPos, int code){
    //GET DIGITS
    //the damage is 3 digits (caps at 300)
    //first digit is least significant, etc
    int firstDigit, secondDigit, thirdDigit;
    firstDigit = (player->damageTaken) % 10;
    secondDigit = ((player->damageTaken) / 10) % 10;
    thirdDigit = ((player->damageTaken) / 100) % 10;

    //display each digit (third,second,first,%) (each number sprite is 20px by 20px width)
    sprite_draw(fbp,numbers[thirdDigit+1],20,20,xPos,yPos);
    sprite_draw(fbp,numbers[secondDigit+1],20,20,xPos+20,yPos);
    sprite_draw(fbp,numbers[firstDigit+1],20,20,xPos+40,yPos);
    sprite_draw(fbp,numbers[0],20,20,xPos+60,yPos); //% sprite
}     

void attackInput(struct player * attacker, struct player * target) {

	int knockback;

	if (attacker->touching) {

		if(target->damageTaken <= 287){
			target->damageTaken += 13;	
		}
		knockback = knockbackCalc(target->damageTaken);
		
		if (attacker->facing == 'R') {

			target->xCoord += knockback;

		} else if (attacker->facing == 'L') {
			target->xCoord -= knockback;

		}

	}

}

int knockbackCalc(int damage) {

    // Seed the random number generator
    srand(time(NULL));

    // Define the base value range (1 to 20)
    int base_value = rand() % 75;// + 10;//used to be +10, removed, so damage has a greater weighting 

    // Calculate the weight based on the input
    int weight = damage / 5; // Adjust this scaling factor as needed

    // Add the weight to the base value
    int result = base_value + weight;

	if (damage < 30 && result > 30) {
		result = 30;
	}

    // Cap the result to 20
    if (result > 75) {
        result = 75;
    }

    return result;
}

