void x_playerCollision(struct player *player1, struct player *player2) {

    /*
    //edge case. if the y-velocity causes the sprite to go forward into the other sprite (from left)
    if (player1->xCoord + player1->xVelocity <= player2->xCoord + allSpriteDims &&
        player1->yCoord + allSpriteDims >= player2->yCoord &&
        player1->yCoord < player2->yCoord + allSpriteDims ) {

            playerOne.xCoord = playerTwo.xCoord - allSpriteDims;

    //coming from the right
    } else if (player1->xCoord + player1->xVelocity >= player2->xCoord &&
        player1->yCoord + allSpriteDims >= player2->yCoord &&
        player1->yCoord < player2->yCoord + allSpriteDims ) {

            playerOne.xCoord = playerTwo.xCoord + allSpriteDims;
    }
    */

    volatile int * RLEDs = (int *) 0xFF200000;     // Red LEDs base address
	*RLEDs = 0b0000000001;

	// Calculate the right boundary of player1 and player2
	int player1_right = player1->xCoord + allSpriteDims;
	int player2_right = player2->xCoord + allSpriteDims;

	// Calculate the bottom boundary of player1 and player2
	int player1_bottom = player1->yCoord + allSpriteDims;
	int player2_bottom = player2->yCoord + allSpriteDims;

    if (player1->xCoord <= player2_right && player1_right >= player2->xCoord &&
    player1->yCoord <= player2_bottom && player1_bottom >= player2->yCoord) {
    // Overlapping
    player1->touching = true;
    player2->touching = true;
    *RLEDs = 0b1000000001;
	} else {
		// Not overlapping
		player1->touching = false;
		player2->touching = false;
	}

     
}

void y_playerCollision(struct player *player1, struct player *player2) {

    //edge case. if the y-velocity causes the sprite to descend further than the other sprite
    if (player1->yCoord + player1->yVelocity >= player2->yCoord - allSpriteDims &&
        player1->xCoord + allSpriteDims > player2->xCoord &&
        player1->xCoord < player2->xCoord + allSpriteDims ) {

            //playerOne.yVelocity = playerOne.yCoord - ground_level;
            player1->yCoord = player2->yCoord - allSpriteDims;
    }

    //player1 approaches from above
    if (player1->xCoord + allSpriteDims >= player2->xCoord &&
        player1->xCoord <= player2->xCoord + allSpriteDims  &&
        player1->yCoord + allSpriteDims  == player2->yCoord) {

        player1->yVelocity = player2->yVelocity; //temporary

    }

    /*

    // player1 approaches from below
    if (player1->xCoord + allSpriteDims  >= player2->xCoord &&
        player1->xCoord <= player2->xCoord + allSpriteDims  &&
        player1->yCoord == player2->yCoord + allSpriteDims ) {

        player1->yVelocity += player2->yVelocity; // temporary

    }
    */

}

